                                          `id` bigint(20) NOT NULL AUTO_INCREMENT,
                                          `orderId` bigint(20) DEFAULT NULL COMMENT '订单ID',
                                          `discountId` bigint(20) DEFAULT NULL COMMENT '优惠ID',
